  ) {
    totalItems
    items {
      sku
      productVariantId
      productName
      slug
      description
      productAsset {
        id
        preview
      }
      priceWithTax {
        ... on SinglePrice {
          value
        }
        ... on PriceRange {
          min
          max
        }
        __typename
      }
      currencyCode
      collectionIds
    }
    collections {
      collection {
        id
        name
        slug
        parentId
        position
      }
    }
